        "    if row['valence'] > 0.5:\n",
        "        return 'agitada'\n",
        "    else:\n",
        "        return 'lenta'\n",
        "\n",
        "# Crie a nova coluna 'target' usando a função categorizar_valence\n",
        "df['target'] = df.apply(categorizar_valence, axis=1)\n",
        "df.head()"
